        }
    }
    
    
   
    render() {
        
        return (
            <div className="container">
                <div className="row">
                    <div className="col-12">
                    <div className="carousel-wrapper position-relative">
                <Carousel />
                <Categories />
            </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default App;
